import React from 'react';

export default function About() {
  return (
    <div className="container p-5">
      <h2>About Us</h2>
      <p>
        CleanSwift is dedicated to making your home and office shine. With years of experience and a
        trained staff, we provide eco-friendly and efficient cleaning services in your city.
      </p>
      <div className="d-flex justify-content-between align-items-start flex-wrap gap-3 mt-3">
  <img
    src="https://iconcpl.com/wp-content/uploads/2023/12/cleaning-service-main.webp"
    style={{ height: '350px', width: '49%' }}
    className="img-fluid rounded"
    alt="Cleaning Service"
  />
  <img
    src="https://mariannas.com/wp-content/uploads/2023/01/Office-Cleaning-Services-For-Hybrid-Work-Schedules-1.jpeg"
    style={{ height: '350px', width: '49%' }}
    className="img-fluid rounded"
    alt="Carpet Cleaning"
  />
</div>
    </div>
  );
}
